%angular

<div id="container" style="height:275px; width: 90%"></div>
<script type="text/javascript">

var chart; // global

/**
 * Request data from the server, add it to the graph and set a timeout 
 * to request again
 */
function requestData() {
    $.ajax({
        url: 'data.html',
        success: function(point) {
            var series = chart.series[0],
                shift = series.data.length > 20; // shift if the series is 
                                                 // longer than 20


            // add the point
            chart.series[0].addPoint(point, true, shift);

            // call it again after one second
            setTimeout(requestData, 1000);    
        },
        cache: false
    });
}

function plotChart() {
    chart = new Highcharts.Chart({
        chart: {
            renderTo: 'container',
            //defaultSeriesType: 'line',
            events: {
                load: requestData
            }
        },
        credits: { 
            enabled: false
        },
        title: {
            text: 'Thousands of Ticks Processed per Second'
        },
        xAxis: {
            type: 'datetime',
            //tickPixelInterval: 150,
            //maxZoom: 20 * 1000
        },
        yAxis: {
            minPadding: 0.2,
            maxPadding: 0.2,
            title: {
                text: 'Kmsgs / sec',
                margin: 80
            }
        },
        plotOptions: {
            area: {
                fillColor: {
                    linearGradient: {
                        x1: 0,
                        y1: 0,
                        x2: 0,
                        y2: 1
                    },
                    stops: [
                        [0, Highcharts.getOptions().colors[0]],
                        [1, Highcharts.Color(Highcharts.getOptions().colors[0]).setOpacity(0).get('rgba')]
                    ]
                },
                marker: {
                    radius: 2
                },
                lineWidth: 1,
                states: {
                    hover: {
                        lineWidth: 1
                    }
                },
                threshold: null
            }
        },
        series: [{
            type: 'area',
            name: 'Time',
            data: []
        }]
    });        
}

function loadLib(url) {
    console.log('Loading library at: ' + url);
    var script = document.createElement('script');
    script.type = 'text/javascript';
    script.src = url;
    script.onload = function() { console.log('Loaded library at: ' + url); }
    script.onerror = function(err) { alert(err); }
    document.getElementsByTagName('head')[0].appendChild(script);
}

// Load each script only once!
if (!window.jQuery) {
    loadLib("http://code.jquery.com/jquery-1.8.2.min.js");
}
if (!window.Highcharts) {
    loadLib("http://code.highcharts.com/highcharts.js");
    loadLib("http://code.highcharts.com/modules/exporting.js");
    loadLib("http://code.highcharts.com/highcharts-more.js");
}
plotChart();

</script>
